let name = "Harry3";
function App() {
  return (
    <>
      <nav>
        <li>Home</li>
        <li>About</li>
        <li>Contact</li>
      </nav>

      <div className="container">
        <h1>Hello {name}</h1>
        <p>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Sint animi
          iusto impedit rem natus obcaecati facilis non accusamus culpa,
          deserunt dicta libero commodi, sunt enim voluptatem tempora quam? Sit,
          quae!
        </p>
      </div>
    </>
  );
}

export default App;
